import './App.css';
import {useState} from "react";
import Axios from "axios";
import 'bootstrap/dist/css/bootstrap.min.css';


function App() {

  const [usuario,setUsuario] = useState("");
  const [contrasenia,setConstrasenia] = useState("");

  const [personaList,setPersonas] = useState([]);

  const send = () => {
    Axios.post("http://localhost:3001/verificar", {
        usuario: usuario,
        contrasenia: contrasenia
    })
    .then(() => {
        alert("Sesión Iniciada");
    })
    .catch((error) => {
        console.error("Error en la autenticación:", error);
        alert("Credenciales incorrectas");
    });
  }

  const getPersonas = () =>{
    Axios.get("http://localhost:3001/reporte").then((response)=>{
      setPersonas(response.data);
    });
  }

  return (
    <div class="container">
      <div className="App">
        <h1 className="titulo">Sistema Cine</h1>
      </div>
      <div class="card text-center">
        <div class="card-header">
          Iniciar sesion
        </div>
        <div className="card-body">
          <div className="input-group mb-3">
            <span className="input-group-text" id="basic-addon1">Usuario: </span>
            <input type="text" 
            onChange={(event)=>{
              setUsuario(event.target.value);
            }}
            className="form-control" placeholder="Username" aria-label="Username" aria-describedby="basic-addon1"/>
          </div>

          <div className="input-group mb-3">
            <span className="input-group-text" id="basic-addon1">Contraseña: </span>
            <input type="password" 
            onChange={(event)=>{
              setConstrasenia(event.target.value);
            }}
            className="form-control" placeholder="Password" aria-label="Username" aria-describedby="basic-addon1"/>
          </div>

        </div>
        <div class="card-footer text-muted">
          <button className='btn btn-success' onClick={send}>Enviar</button>
        </div>

      </div>
      <div className='lista'>
            <button onClick={getPersonas}>Listar</button>

      </div>
      <table class="table table-sm">

        <thead>
          <tr>
          <th scope="col">#</th>
            <th scope="col">Nombres</th>
            <th scope="col">Primer Apellido</th>
            <th scope="col">Segundo Apellido</th>
            <th scope="col">Nacionalidad</th>
          </tr>
        </thead>
        <tbody>
        {
              personaList.map((val,key)=>{
                return <div className=''>{val.nombres}</div>
              })
            }
          <tr>
            <th scope="row">1</th>
            <td>Mark</td>
            <td>Otto</td>
            <td>@mdo</td>
          </tr>
          <tr>
            <th scope="row">2</th>
            <td>Jacob</td>
            <td>Thornton</td>
            <td>@fat</td>
          </tr>
          <tr>
            <th scope="row">3</th>
            <td colspan="2">Larry the Bird</td>
            <td>@twitter</td>
          </tr>
        </tbody>

      </table>
    </div>
  );
}

export default App;
